translateText.expectJsonc:
[
    {
        "name": "text",
        "type": "text",
        "label": "Text",
        "required": true,
        "help": "Text to be translated. Only UTF8-encoded plain text is supported."
    },
    {
        "name": "target_lang",
        "type": "select",
        "label": "Target Language",
        "options": "rpc://targetLanguages",
        "required": true
    },
    {
        "name": "source_lang",
        "type": "select",
        "label": "Source Language",
        "options": "rpc://sourceLanguages",
        "help": "If this parameter is omitted, the API will attempt to detect the language of the text and translate it."
    },
    {
        "name": "split_sentences",
        "type": "select",
        "label": "Split Sentences",
        "options": [
            {
                "label": "Treat as One Sentence",
                "value": "0"
            },
            {
                "label": "Split on Punctuation and on Newlines",
                "value": "1"
            },
            {
                "label": "Split on Punctuation Only (Ignore Newlines)",
                "value": "nonewlines"
            }
        ],
        "help": "Sets whether the translation engine should first split the input into sentences. When sending one sentence per text parameter, it is advisable to set `split_sentences=0`, in order to prevent the engine from splitting the sentence unintentionally."
    },
    {
        "name": "preserve_formatting",
        "label": "Preserve Formatting",
        "type": "boolean",
        "help": "Sets whether the translation engine should respect the original formatting, even if it would usually correct some aspects.\nThe formatting aspects affected by this setting include:\n- Punctuation at the beginning and end of the sentence\n- Upper/lower case at the beginning of the sentence"
    },
    {
        "name": "glossary_id",
        "label": "Glossary ID",
        "type": "select",
        "options": "rpc://glossaries",
        "help": "Specify the glossary to use for the translation. Important: This requires the `source_lang` parameter to be set and the language pair of the glossary has to match the language pair of the request."
    },
    {
        "name": "tag_handling",
        "label": "Tag Handling",
        "type": "select",
        "options": [
            {
                "label": "XML",
                "value": "xml"
            }
        ],
        "help": "Sets which kind of tags in the text should be handled."
    },
    {
        "name": "non_splitting_tags",
        "type": "text",
        "label": "Non Splitting Tags",
        "help": "Comma-separated list of XML tags which never split sentences. For example `par,title`."
    },
    {
        "name": "outline_detection",
        "type": "boolean",
        "label": "Outline Detection",
        "help": "The automatic detection of the XML structure won't yield best results in all XML files. You can disable this automatic mechanism altogether by setting the `outline_detection` parameter to `false` and selecting the tags that should be considered structure tags. This will split sentences using the `splitting_tags` parameter."
    },
    {
        "name": "splitting_tags",
        "type": "text",
        "label": "Splitting Tags",
        "help": "Comma-separated list of XML tags which always cause splits. For example `par,title`."
    },
    {
        "name": "ignore_tags",
        "type": "text",
        "label": "Ignored Tags",
        "help": "Comma-separated list of XML tags that indicate text not to be translated. For example `par,title`."
    }
]

deepl.apiJsonc:
{
    "url": "{{if(parameters.url, parameters.url + '/usage', 'https://api-free.deepl.com/v2/usage')}}",
    "headers": {
        "authorization": "DeepL-Auth-Key {{parameters.apiKey}}"
    },
    "response": {
        "error": {
            "message": "[{{statusCode}}] Something went wrong.",
            "400": {
                "message": "[{{statusCode}}] Bad request. Please check error message and your parameters."
            },
            "403": {
                "message": "[{{statusCode}}] Authorization failed. Please supply a valid auth_key parameter."
            },
            "404": {
                "message": "[{{statusCode}}] The requested resource could not be found."
            },
            "413": {
                "message": "[{{statusCode}}] The request size exceeds the limit."
            },
            "414": {
                "message": "[{{statusCode}}] The request URL is too long. You can avoid this error by using a POST request instead of a GET request, and sending the parameters in the HTTP body."
            },
            "429": {
                "message": "[{{statusCode}}] Too many requests. Please wait and resend your request."
            },
            "456": {
                "message": "[{{statusCode}}] Quota exceeded. The character limit has been reached."
            },
            "503": {
                "message": "[{{statusCode}}] Resource currently unavailable. Try again later."
            },
            "529": {
                "message": "[{{statusCode}}] Too many requests. Please wait and resend your request."
            }
        }
    },
    "log": {
        "sanitize": [
            "request.headers.authorization"
        ]
    }
}

